import './List.css'
import Img from '../img.png'

export default function List({items, titleImg}) {
    // console.log(typeof(items));
    console.log(items);


    return (

            <Carousel className="car">
                return <Carousel.Item className="car">
                    </Carousel.Item>
            { items.map((item, index)=> {
                    {/* <img className="d-block w-100" src={Img} alt="img"  img={item} key={index}/> */}
                    <img src={Img} alt=""/>
            })}
            </Carousel>


    )
}
